var size=1e5,data_bin=typeof Uint8Array!="undefined"?new Uint8Array(size):new Array(size);for(var i=data_bin.length-1;i>=0;i--)data_bin[i]=Math.random(256)*256&255;var cmp=function(e,t){if(e.length!==t.length)return!1;for(var n=0,r=e.length;n<r;n++)if(e[n]!==t[n])return!1;return!0};describe("Generic",function(){it("defaults",function(){assert(cmp(data_bin,pako.inflate(pako.deflate(data_bin))))}),describe("levels",function(){it("0",function(){assert(cmp(data_bin,pako.inflate(pako.deflate(data_bin,{level:0}))))}),it("1",function(){assert(cmp(data_bin,pako.inflate(pako.deflate(data_bin,{level:1}))))}),it("4",function(){assert(cmp(data_bin,pako.inflate(pako.deflate(data_bin,{level:4}))))}),it("6",function(){assert(cmp(data_bin,pako.inflate(pako.deflate(data_bin,{level:6}))))})})});